After two years of incredible work and inspiring team effort, my second album—Going Off Script: The Ornamented Suites for Cello—will release on September 10th! 🎉🎉🎉
•
•
I can’t even begin to tell you how thrilled I am to send Little Baby Juggernaut out into the world . The experience of recording the Bach cello suites with ornamentation has easily been the most challenging and transformative of my career, and I hope you’ll enjoy the results! 😊
•
•
You can learn more about the album (and hear some delicious snippets in advance of the album pre-order) via the YouTube link in my bio. 🎶🎥 Check it out, Subscribe if you like, and stay tuned for more details!! •
